import React, { Component } from "react";
import NavBar from "../../components/NavBar/NavBar";
import "./Home.css";

class Home extends Component {
  state = {
    someShit: "Fuck"
  };

  render() {
    return (
      <>
        <div className="body">
          And I am whatever you say I am. If I wasn't, then why would I say I
          am?. In the paper, the news, every day I am. Radio won't even play my
          jam. ‘Cause I am whatever you say I am. If I wasn't, then why would I
          say I am?. In the paper, the news, every day I am. I don't know, it's
          just the way I am.I’m the American Dream. I’m the definiton of white
          trash ballin’. I’m right back on 'em. With a (chicka chicka chicka) I
          can’t call it. Same shit, different toilet. Oh, you got a nice ass,
          darling. Can’t wait to get you into my Benz, take you for a spin. What
          you mean we ain't fuckin’? You take me for a friend?. Let me tell you
          the whole story of Shady’s origin.
        </div>
        <div className="NavBar">
          <NavBar />
        </div>
      </>
    );
  }
}

export default Home;
